import React from 'react';

export default class NavBar extends React.Component{
  render() {
    return (
      <div className="navbar">
        <div>
          <h3>Matcha</h3>
        </div>
        <div>
          <button className="btn"></button>
        </div>
        <ul>
          <li>Profile</li>
          <li>Settings</li>
          <li>Logou</li>
        </ul>
      </div>
  )}
}
